pragma solidity >= 0.5.6;

import "./open/utils/Initializable.sol";
import "./open/utils/Ownable.sol";


contract Relation is Initializable,Ownable{

    address constant public rootAddress = address(0x000000000000000000000000000000000000dEaD);

    uint public totalAddresses;
    //上线记录
    mapping (address => address) public _recommerMapping;

    mapping( address => address[]) firstChilds;

    struct User{
        uint firstNum;
        uint teamNum;
    }

    mapping(address => User) public users;

    constructor() public {}

     function initialize(address owner) public initializer {
         _owner = owner;
       _recommerMapping[rootAddress] = address(0xdeaddead);
    }

    function addRelationEx(address recommer) external returns (bool) {

        require(recommer != msg.sender,"your_self");

        require(_recommerMapping[msg.sender] == address(0x0),"binded");

        require(recommer == rootAddress || _recommerMapping[recommer] != address(0x0),"p_not_bind");

        totalAddresses++;

        _recommerMapping[msg.sender] = recommer;

        firstChilds[recommer].push(msg.sender);

        users[recommer].firstNum += 1;
        users[recommer].teamNum += 1;

        address p = _recommerMapping[recommer];
        if( p != rootAddress ){
             users[p].teamNum += 1;
        }
        return true;
    }

     function getForefathers(address owner,uint num) external view returns(
         address[] memory fathers,uint[] memory childs){

        fathers = new address[](num);
        childs = new uint[](num);

        address parent  = owner;
        for( uint i = 0; i < num; i++){
            parent = _recommerMapping[parent];

            if( parent == rootAddress || parent == address(0) ) break;

            fathers[i] = parent;
            childs[i] = firstChilds[parent].length;
        }
    }

    function getChilds(uint256 start,uint256 end)external view returns(address[] memory _childs){

        uint len = users[msg.sender].firstNum;

        if( end >= len ) end = len -1;

        if( end >= start ){
            uint size = end - start + 1;

            _childs = new address[](size);

            address[] storage cs = firstChilds[msg.sender];

            for( (uint i,uint k) = (start,0); i <= end && k < size; (i++,k++)){
                _childs[k] = cs[i];
            }
        }
    }
}
